import {Router} from 'express'
const router= Router();

import * as productsCtrl from '../controllers/products.controller';
import {authJwt } from '../middlewares'

router.post('/',[authJwt.verifyToken,authJwt.isModerator],productsCtrl.createProducts)

router.get('/',productsCtrl.getProducts)

router.get('/:productId',productsCtrl.getProductById)

router.put('/:productId',[authJwt.verifyToken,authJwt.isAdm],productsCtrl.updateProductById)

router.delete('/:productId',[authJwt.verifyToken,authJwt.isAdm],productsCtrl.deleteProductById)


export default router;

