import {Router} from 'express'
const router= Router()
import * as userCtrl from '../controllers/user.controller'
import { authJwt } from '../middlewares';

router.post('/', [
    authJwt.verifyToken,
    authJwt.isAdm
],userCtrl.createUser);

export default router;

